CREATE FUNCTION app.check_jit_permission() RETURNS trigger
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    v_until TEXT;
    v_op TEXT;
    v_real_user TEXT;
BEGIN
    -- Получаем реального пользователя сессии
    v_real_user := session_user;

    -- Если это суперпользователь - пропускаем (но проверяем session_user!)
    IF v_real_user = 'postgres' THEN
        RETURN OLD;
    END IF;

    -- Читаем переменные сессии
    v_until := current_setting('app.temp_privilege_until', true);
    v_op := current_setting('app.temp_privilege_op', true);

    -- Проверка 1: Запрошена ли вообще привилегия?
    IF v_until IS NULL OR v_op != 'DELETE_DEVICE' THEN
        RAISE EXCEPTION 'JIT Error: You must request temporary privilege for DELETE operation via app.request_temp_privilege()';
    END IF;

    -- Проверка 2: Не истекло ли время?
    IF now() > v_until::timestamptz THEN
        RAISE EXCEPTION 'JIT Error: Temporary privilege expired at %', v_until;
    END IF;

    RETURN OLD;
END;
$$;


ALTER FUNCTION app.check_jit_permission() OWNER TO postgres;

