    RETURNING id INTO new_device_id;

    VALUES ('app.register_new_device', session_user, log_params, true);

    RETURN jsonb_build_object('success', true, 'new_id', new_device_id, 'message', 'Устройство успешно зарегистрировано');

END;
$$;


