--

CREATE FUNCTION app.request_temp_privilege(p_operation text, p_duration_min integer) RETURNS text
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    v_expires_at TIMESTAMPTZ;
BEGIN
    IF p_operation != 'DELETE_DEVICE' THEN
        RAISE EXCEPTION 'Operation % is not supported for JIT access', p_operation;
    END IF;

    v_expires_at := now() + (p_duration_min || ' minutes')::interval;

    -- ИСПОЛЬЗУЕМ session_user вместо current_user, чтобы записать реального автора
    VALUES (session_user, p_operation, p_duration_min, v_expires_at);

    PERFORM set_config('app.temp_privilege_until', v_expires_at::text, false);
    PERFORM set_config('app.temp_privilege_op', p_operation, false);

    RETURN 'Privilege granted until ' || v_expires_at::text;
END;
$$;


