CREATE FUNCTION app.set_session_ctx(p_employee_id integer, p_project_id integer) RETURNS void
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    v_exists BOOLEAN;
BEGIN
    SELECT EXISTS(
        SELECT 1
        FROM stg.employee_projects
        WHERE employee_id = p_employee_id AND project_id = p_project_id
    ) INTO v_exists;

    IF v_exists THEN
        PERFORM set_config('app.current_project_id', p_project_id::text, false);
        RAISE NOTICE 'Контекст установлен: Сотрудник % -> Проект %', p_employee_id, p_project_id;
    ELSE
        RAISE EXCEPTION 'Access denied: Employee % does not have access to Project %', p_employee_id, p_project_id;
    END IF;
END;
$$;


