CREATE FUNCTION audit.backup_audit_logs(days_interval integer) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
    moved_rows INT;
BEGIN
    WITH moved AS (
        DELETE FROM audit.row_change_log
        WHERE changed_at < now() - (days_interval || ' days')::interval
        RETURNING *
    )
    SELECT * FROM moved;
    
    GET DIAGNOSTICS moved_rows = ROW_COUNT;
    RAISE NOTICE 'Архивировано записей: %', moved_rows;
END;
$$;


