    AS $$
DECLARE
    v_old_data JSONB;
    v_new_data JSONB;
BEGIN
    v_old_data := to_jsonb(OLD);
    
    IF (TG_OP = 'UPDATE') THEN
        v_new_data := to_jsonb(NEW);
        
        IF (TG_TABLE_NAME = 'devices') THEN
             v_new_data := v_new_data || '{"location": "*** MASKED ***"}';
             v_old_data := v_old_data || '{"location": "*** MASKED ***"}';
        END IF;
    ELSE
        v_new_data := NULL;
    END IF;

        table_name, operation_type, record_id, changed_by, old_data, new_data
    ) VALUES (
        TG_TABLE_NAME, 
        SUBSTRING(TG_OP, 1, 1), 
        OLD.id::text, 
        current_user, 
        v_old_data, 
        v_new_data
    );
    
    RETURN NULL;
END;
$$;


